import { useEffect } from "react"
import { useDispatch, useSelector } from "react-redux"
import { useParams } from "react-router-dom"
import { takeOrder } from "../store/actions/shop-action"
const status = [
  "Confirmed",
  "Cancelled",
  "Sent To Kitchen",
  "Ready for Pickup",
  "Ready for Delivery",
  "Delivered",
]
const OrderDetail = () => {
  const { orderId } = useParams()
  const order = useSelector(state => state.shop.order)
  const group = useSelector(state => state.shop.groups)
  const dispatch = useDispatch()
  useEffect(() => {
    dispatch(takeOrder(orderId))
  }, [dispatch, orderId])

  return console.log(order), console.log(group), (<></>)
}

export default OrderDetail
